import './styles.css';

function App() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  return (
    <div className="conteudo">
      <div className="conteudo-login">
        <form className="conteudo-login-form">
          <h1 className="conteudo-login-form-titulo">Login</h1>

          <div className="conteudo-login-form-input">
            <input
              className="input"
              type="email"
              value={email}
              onChange={e => setEmail(e.target.value)}
              placeholder="Email" />
          </div>

          <div className="conteudo-login-form-input">
            <input
              className="input"
              type="password"
              value={password}
              onChange={e => setPassword(e.target.value)}
              placeholder="Senha" />
          </div>

          <div className="conteudo-login-form-botao">
            <button className="login-form-botao">Entrar</button>
          </div>

          <div className="conteudo-login-texto">
            <span className="login-texto">NÃ£o possui conta?</span>
            <a className="login-ancora" href="#">Criar conta</a>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
